import Navbar from "./headers/navBar.js";
import Footer from "./footers/footer.js";
import { Button } from "react-bootstrap";
import Landingpage from "./landingPage/landingPage.js";

function App() {
    return (
        <>
            <Navbar></Navbar>
            <main></main>
            <Landingpage></Landingpage>
            <Footer></Footer>
        </>
    );
}

export default App;
